<script>
    document.querySelector(`.region_wrapper`).offsetHeight

    $(document).ready(()=>{
        const selected_region = 'ahal_region'
        $(`.region_wrapper[data-region-name="${selected_region}"]`).addClass('active')
        $(`#${selected_region}`).addClass('active')
        $(`.region_name[data-region-id="${selected_region}"]`).addClass('active')

        $('.region').on('click',(event) => {

            $('.region').removeClass('active')
            $('.region_name').removeClass('active')
            $('.region_wrapper').removeClass('active') 
            $('#island').css('stroke', "") 

            $(`.region#${event.target.id}`).addClass('active')
            $(`.region_name[data-region-id="${event.target.id}"]`).addClass('active')
            $(`.region_wrapper[data-region-name="${event.target.id}"]`).addClass('active')

            if(event.target.id == 'balkan_region'){
                $('#island').css('stroke', "var(--region_stroke_hover)")
            }

        })

    })

</script>